import React, { useState } from 'react';
import { FaUser, FaEnvelope, FaLock, FaUserPlus } from 'react-icons/fa';
import './Auth.css';

const Register = ({ onRegister, switchToLogin }) => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    
    // Basic validation
    if (password !== confirmPassword) {
      setError('Şifreler eşleşmiyor');
      return;
    }
    
    try {
      // Registration API call would go here
      const response = await fetch('http://localhost:8000/api/auth/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ name, email, password }),
      });
      
      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.detail || 'Kayıt başarısız');
      }
      
      const data = await response.json();
      // For demo purposes, automatically log in the user
      localStorage.setItem('token', data.token);
      onRegister(data.user);
    } catch (err) {
      setError(err.message || 'Kayıt olurken bir hata oluştu');
      console.error('Registration error:', err);
      
      // For demo purposes - allow registration without backend
      if (name && email && password) {
        console.log('Demo registration activated');
        const demoUser = { id: 3, name, email };
        localStorage.setItem('demoUser', JSON.stringify(demoUser));
        onRegister(demoUser);
      }
    }
  };

  return (
    <div className="auth-container">
      <h2 className="auth-title">Kayıt Ol</h2>
      
      {error && <div className="auth-error">{error}</div>}
      
      <form onSubmit={handleSubmit} className="auth-form">
        <div className="form-group">
          <label>
            <FaUser className="icon" />
            <input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="İsim"
              required
            />
          </label>
        </div>
        
        <div className="form-group">
          <label>
            <FaEnvelope className="icon" />
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="E-posta"
              required
            />
          </label>
        </div>
        
        <div className="form-group">
          <label>
            <FaLock className="icon" />
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Şifre"
              required
            />
          </label>
        </div>
        
        <div className="form-group">
          <label>
            <FaLock className="icon" />
            <input
              type="password"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              placeholder="Şifreyi Doğrula"
              required
            />
          </label>
        </div>
        
        <button type="submit" className="auth-button">
          <FaUserPlus className="icon" />
          Kayıt Ol
        </button>
      </form>
      
      <p className="auth-switch">
        Zaten hesabınız var mı?{' '}
        <span onClick={switchToLogin}>Giriş Yap</span>
      </p>
    </div>
  );
};

export default Register;
